import React from 'react';
import CombinedBarChart from './CombinedBarChart';

const App = () => {
  // Sample data tables for demonstration
  const dataTables = [
    [
      { date: '2023-08-01', totalInvocations: 10 },
      { date: '2023-08-02', totalInvocations: 20 },
      // Add more data for Data 1
    ],
    [
      { date: '2023-08-01', totalInvocations: 15 },
      { date: '2023-08-02', totalInvocations: 25 },
      // Add more data for Data 2
    ],
    // Add more data tables as needed
  ];

  return (
    <div>
      <h1>Combined Bar Chart</h1>
      <CombinedBarChart dataTables={dataTables} />
    </div>
  );
};

export default App;
